import React from "react";
const bigSkills = [
  "Object-Oriented Programming",
  "Web Development",
  "Debugging",
  "Mathematics",
  "Communication",
];
const mediumSkills = ["javascript", "bongo"];
const smallSkills = ["Algorithms", "ring", "a", "ting", "tongo"];
let skills = bigSkills.concat(mediumSkills).concat(smallSkills);
for (let i = skills.length - 1; i > 0; i--) {
  let j = Math.floor(Math.random() * (i + 1));
  [skills[i], skills[j]] = [skills[j], skills[i]];
}

function Skills() {
  return (
    <div id="skills-section" className="section">
      <h4>Skills & Technologies</h4>
      <ul id="skills-ul">
        {skills.map((sk) => {
          return (
            <li
              className={
                bigSkills.includes(sk)
                  ? "big-skill"
                  : mediumSkills.includes(sk)
                  ? "medium-skill"
                  : "small-skill"
              }
            >
              {sk}
            </li>
          );
        })}
      </ul>
    </div>
  );
}

export default Skills;
